C.Vh=new L.C("When the drawer is opened in bottom navigation mode, also include the bottom destinations in it. By default they are excluded and only shown when needed to avoid being stranded. Normal usage and convention is to keep this OFF as it may be confusing. It can also be convenient, as it gives you two simultaneous ways to navigate.",null,null,null,null,null,null,null,null)
