C.VR=new L.C("The Material guide shows the sidebar as a part of the scaffold body. Turn ON this setting to to follow the guide. Flexfold defaults to having it outside the body, like the side menu and rail. It also gets its own app bar when locked to the side. The setting affects if a bottom bar covers the sidebar or not and impacts standard FAB locations when the sidebar is visible.",null,null,null,null,null,null,null,null)
C.VS=new L.C("If the app bar is dark or white, a border will be drawn at its bottom side. With the API you can set this separately for the app bar on the menu and main body, as well as on the sidebar app bar.",null,null,null,null,null,null,null,null)
C.VU=new L.C("\nThe sidebar can be used to hold less used content in an application. It could be a search filter, a list of picked or selected items, maybe even usage instructions and guides.\n\nWhen you define Flexfold destinations, you can define which destinations should have a sidebar, every destination does not have to have one. In this demo app only the Setup, Theme, Tabs and Slivers destinations have a sidebar, the other pages do not have one.\n",null,null,null,null,null,null,null,null)
C.z7=new L.C("Always show bottom navigation bar",null,null,null,null,null,null,null,null)
C.VV=new L.C("Show tooltips",null,null,null,null,null,null,null,null)
C.VW=new L.C("List tile sub title",null,null,null,null,null,null,null,null)
C.VX=new L.C("This demo app has a mockup user profile as a leading widget, showing it can be a complex widget. It is up to the implementation to make one that works OK in all modes.",null,null,null,null,null,null,null,null)
C.VY=new L.C("For the page content layout, there is a Breakpoint class used to get suitable amount of columns for the grid images. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize the screen on a 4K display and toggle the menu, the menu animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame as the menu animates. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter. This demo app could perhaps be better optimized too.\n\nThe Undraw images bundled with the app are used as demo content in the grid. Each image box that randomly display one of the images, has its own random wait duration before it switches, they also have a random switch animation time. Each image box gets a random colored border box, a less saturated version of the color is calculated for dark mode. Thus when you switch to dark mode, it still has the same color hue based on the light theme's random color. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail is that each image is also using the same color as the border, as the color theme of each image.\n\nThere are only 30 different images that are switched in randomly to each position in the grid. This demo list stops at 500 items in the grid. As such the page is not very useful, but it's a nice looking Flutter stress test, especially on the web.\n\nWith this page you can also test and see how Slivers work when the sidebar is a part of Scaffold body or outside it. It has bigger visual impact when a bottom navigation bar is used on a large canvas layout. Here we can use the toggle to always show the bottom navigation bar to see the difference. The setting that shows the bottom bar when the menu is manually hidden and sidebar remains pinned visible, is probably a more real use case for when the bottom navigation bar would be used on a large canvas.\n",null,null,null,null,null,null,null,null)
C.VZ=new L.C("Could not load asset image!",null,null,null,null,null,null,null,null)
C.W0=new L.C("Flexfold is a smooth responsive scaffold package for Flutter. This application demonstrates its core features.\n\nThe responsive navigation modes automatically change from bottom navigation bar, to rail and to side menu as the canvas size grows. The smooth part is that the switches from one mode to another are animated.\n\nOn a large canvas the user can control the desired navigation mode with the menu button and toggle the side menu from being hidden in a drawer, to a rail, to fully visible as a side menu. You change navigation mode by clicking on the menu button. The menu button only toggles the menu style between allowed navigation modes based on current canvas size and defined navigation mode breakpoint constraints.\n",null,null,null,null,null,null,null,null)
C.W2=new L.C("Keep menu in drawer below height",null,null,null,null,null,null,null,null)
C.W3=new L.C("Dark theme",null,null,null,null,null,null,null,null)
C.z8=new L.C("Copy to custom",null,null,null,null,null,null,null,null)
C.W6=new L.C("Keep sidebar hidden",null,null,null,null,null,null,null,null)
C.W8=new L.C("When enabled, users can use the end drawer menu button to hide and show the sidebar, if it is possible to do so based on canvas size and breakpoint constraints.",null,null,null,null,null,null,null,null)
C.Wa=new L.C("Rail width",null,null,null,null,null,null,null,null)
C.Wc=new L.C("Switch list tile",null,null,null,null,null,null,null,null)
C.Wb=new L.C("This demo uses the newer Flutter Material 2018 typography instead of the older current Flutter default one from 2014. This creates a slightly different look.\n\nThe FlexColorScheme API allows you to set visualDensity, fontFamily, platform and typography directly without having to use the standard ThemeData factory. For more involved theme customization you can also create the starting point theme data object by using FlexColorScheme().theme and apply additional theming to it with Flutter's standard methods.\n",null,null,null,null,null,null,null,null)
C.Wd=new L.C("The breakpoints for when the navigation mode changes, can be adjusted. The defaults work well enough for most use cases.\n\nTo keep the rail as slim as possible, navigation destination labels only appear as tooltips in rail mode. This results in a slim un-intrusive icon only rail, that is suitable for tablets in portrait mode and if so desired, it can also be used in landscape mode on phones.\n\nA sidebar using an end drawer, that can also become a permanent fixture on a wide enough canvas, is also supported. The sidebar entrance also animates when its breakpoint is exceeded. The sidebar's visibility as a permanent fixture can also be toggled with its menu button.\n\nThe widths of the rail, side menu and the tools menu can be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The Flexfold API has even more features than those demonstrated in the demo.\n\nYou will find the key settings on the Setup page, but there are some usage hints and setup info gems on other pages in the this demo app as well.",null,null,null,null,null,null,null,null)
C.Wj=new L.C("Theming is not a part of Flexfold, it is included as an extra feature in this demo application. The theming shown here is done with another package called FlexColorScheme. This page presents the kind of theming that is simplified by using it.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. It is similar to the standard ThemeData.from in that a theme is created from a ColorScheme. It has two convenience factories, FlexColorScheme.light and FlexColorScheme.dark. FlexColorScheme also address some theme gaps in the standard Theme.from ColorScheme.\n\nFlexColorScheme supports using a white appbar theme in light mode and a primary colored one in dark mode. Dark mode also support an even darker mode called true black. Different levels of pre-defined branded surface colors, with primary color blended into surfaces to create color branded light and dark themes are also supported.\n\nIn addition to the default material design standard theme, which is also included in the Flutter's ColorScheme, FlexColorScheme comes comes with a few extra themes to get you started theming your app.\n",null,null,null,null,null,null,null,null)
C.Wk=new L.C("ON by default, but you can turn it off.",null,null,null,null,null,null,null,null)
C.z9=new L.C("Frosted glass blur effect",null,null,null,null,null,null,null,null)
C.Wm=new L.C("Full responsive layout of the content body in this app is not part of the Flexfold demo and has not been paid too much attention to, but it has been verified to work well enough from normal phone sizes to large web and desktop canvas sizes. The content presentation is however not always optimally designed for phones.",null,null,null,null,null,null,null,null)
C.Wq=new L.C("Show bottom navigation when menu is hidden",null,null,null,null,null,null,null,null)
C.Ws=new L.C("Not Selected Chip",null,null,null,null,null,null,null,null)
C.Wt=new L.C("Normal app bars can be a bit dull. This demo shows how you can make them more interesting by introducing a gradient, together with an optional transparency that also increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar, as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null)
C.Wu=new L.C("Use iOS blur effect on none iOS bottom bars. Cupertino bottom navigation bar is always frosted glass blurred when transparent.",null,null,null,null,null,null,null,null)
C.Ww=new L.C("\nFlexfold destinations can also be configured to use FABs. FAB usage can be defined per destination.\n ",null,null,null,null,null,null,null,null)
C.Wx=new L.C("",null,null,null,null,null,null,null,null)
C.WA=new L.C("Enable manual menu toggle control",null,null,null,null,null,null,null,null)
C.Wy=new L.C("With Flexfold it is easy to include a gradient transparent app bar, there is a styled app bar factory to help make app bars like the ones you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. If you want to go full iOS style, then use the frosted glass blur style on a material app bar as well. The frosted glass style is ON by default in this demo, but feel free to try experiment with different settings\n\nThis page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo.\n\nThe Settings page already contains the app bar settings below. This page just explained in a bit more detail how the app bar  made with the styled factory can be useful. There is also a feature that shows the current canvas size in the app bar. You can use it to verify that your responsive layouts work as designed during development.\n",null,null,null,null,null,null,null,null)
C.WB=new L.C("This demo has an extra theme switch as a trailing widget.",null,null,null,null,null,null,null,null)
C.WD=new L.C("Keep bottom navigation bar hidden",null,null,null,null,null,null,null,null)
C.WE=new L.C("Top side border",null,null,null,null,null,null,null,null)
C.WF=new L.C("Keep using the rail even when the show menu breakpoint is exceeded.",null,null,null,null,null,null,null,null)
C.WG=new L.C("Just because we can and for fun, let us show all the beautiful Undraw SVG images used in this demo app in a grid and then randomly animate in a new one.\n\nEach image box that randomly display one of the images has its own random wait duration before it switches and also a random switch animation time.\n\nEach time the screen is built, each image box gets a random colored border and a less saturated version of it is calculated for dark mode. When you switch to dark mode, it still has the same color hue based on the light theme's random color.\n\nAnother feature is that every image is color themed dynamically to match the color of its border. This is done by changing a color text string in the SVG file image data.\n",null,null,null,null,null,null,null,null)
C.WH=new L.C("Selected list tile title",null,null,null,null,null,null,null,null)
C.WI=new L.C("Show the bottom navigation bar also when the rail or menu is shown.\nCAUTION: Not recommended, it may be confusing. Used mostly for testing purposes, but it can also be useful as an accessibility feature.",null,null,null,null,null,null,null,null)
C.WJ=new L.C('The Flexfold layout design is primarily intended for Flutter applications that target Desktop and Web, but it is also useful for resizable apps on tablets and Chrome books. Sure, it works great for switching between portrait and landscape mode on phones and standard tablets too, offering navigation mode flexibility on them as well. It is very useful when you make a single app that needs to support layout and navigation on phones, tablets, desktop and web canvas sizes, with the same code base.\n\nThis Flexfold feature demonstration application uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also enable URL based routes if you plan to release your Flutter app on the Web. The "onDestinationSelected" callback from the Flexfold package provides not just an index for the tapped destination, but a class with the values that you see in each page header in this demo.\n',null,null,null,null,null,null,null,null)
C.WK=new L.C("The sidebar can of course contain any kind of widget. This example share the same content on all pages that have a side sidebar, but of course you can show whatever you like, just make sure that it fits nicely in the available width.\n\nJust for fun, here are some themed faster switching random Undraw images.",null,null,null,null,null,null,null,null)
C.WL=new L.C("Keep rail and menu hidden",null,null,null,null,null,null,null,null)
C.WM=new L.C("Use a gradient app bar to make it more dynamic. The gradient color is based on your app bar color. With API you can change direction, which is used in this demo on the menu and sidebar app bars.",null,null,null,null,null,null,null,null)
C.WN=new L.C("Show the bottom navigation bar also when the rail or menu is shown. CAUTION: Not recommended, it can be confusing. Used mostly for testing purposes, but it may also be useful as an accessibility feature.\nOn this demo page it is a handy way to see the bottom navigation bar regardless of canvas size.",null,null,null,null,null,null,null,null)
