C.Xx=new L.C("Flexfold offers a large number of responsive behaviors that you can adjust via its API or allow users to modify via settings, like in this demo.\n\nIn addition to the responsive settings there are style settings that are easy to adjust to create a personalized look.\n\nThe navigation mode changes are animated to create a smooth transition from bottom, to rail and side menu. The animation durations and curves can be adjusted.\n\nWidth of the rail, locked menu and sidebar can also be changed, within given limitations.\n",null,null,null,null,null,null,null,null)
