C.XU=new L.C("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you usually want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all the destinations in a rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it, into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null)
